import React from 'react';
import { Link } from 'react-router-dom';
import navs from './Nav.module.css';
import img1 from '../images/logo.svg';
import img2 from '../images/calculation.svg';
import img3 from '../images/measering.svg';

const Nav = () => {
    return (
        <nav className={navs.nav}>
            <div className={navs.logoContainer}>
                <img src={img1} alt="pic" className={navs.logo} />
            </div>
            <ul className={navs.Links}>
                <li><Link to="/services">Services</Link></li>
                <li><Link to="/products">Products</Link></li>
                <li><Link to="/aboutus">About Us</Link></li>
                <li><Link to="/portfolio">Portfolio</Link></li>
                <li><Link to="/faq">FAQ</Link></li>
                <li><Link to="/contacts">Contacts</Link></li>
            </ul>
            <div className={navs.buttons}>
                <Link to="/make-request" className={`${navs.button} ${navs.requestButton}`}>
                    <img src={img3} alt="Measuring" />
                    Make Request
                </Link>
                <Link to="/calculation" className={`${navs.button} ${navs.calculationButton}`}>
                    <img src={img2} alt="Calculation" />
                    Calculation
                </Link>
            </div>
        </nav>
    );
};

export default Nav;
